const btn = document.querySelectorAll(".btn");
const youSymble = document.getElementById("youSymble");
const message = document.querySelector(".message");
const submit = document.querySelector(".subimt");
const addInfo = document.querySelector(".addInfo");
const overlay = document.querySelector(".overlay");
const closeBtn = document.querySelector(".close-btn");
const show = document.querySelector(".show");
const uploadBtn = document.querySelector(".upload-btn");

const mobileOpen = document.querySelector(".open");
mobileOpen.addEventListener("click", () => {
  addInfo.classList.add("box");
  overlay.classList.add("box");
});

const symbolArray = [];

let num = 1;
btn.forEach((el) =>
  el.addEventListener("click", (e) => {
    const value = e.target.innerText;

    num++;
    if (num <= 13) {
      symbolArray.push(value);
      youSymble.textContent = [...symbolArray].join(" ");
    }
    if (num == 13) {
      show.classList.add("green");
    }
  })
);

let imageData;

function readFile() {
  if (this.files && this.files[0]) {
    let FR = new FileReader();

    FR.addEventListener("load", function (e) {
      const imageString = e.target.result;
      imageData = imageString;
    });

    FR.readAsDataURL(this.files[0]);
    uploadBtn.classList.add("green");
  }
}

document.getElementById("imageCode").addEventListener("change", readFile);

///////////////////////////////////
const canvas = document.getElementById("canvas");
const ctx = canvas.getContext("2d");

const imageOne = new Image();

imageOne.src =
  "data:image/png;base64,";

[submit, closeBtn].forEach((el) =>
  el.addEventListener("click", () => {
    imageOne.src = imageData;
    addInfo.classList.remove("box");
    overlay.classList.remove("box");
  })
);
const inputSlider = document.getElementById("resolution");
const inputLable = document.getElementById("resolutionLabel");

inputSlider.addEventListener("change", handelSlider);

class Cell {
  constructor(x, y, symbol, color) {
    this.x = x;
    this.y = y;
    this.symbol = symbol;
    this.color = color;
  }

  draw(ctx) {
    ctx.fillStyle = "white";
    ctx.fillText(this.symbol, this.x + 0.5, this.y + 0.5);
    ctx.fillStyle = this.color;
    ctx.fillText(this.symbol, this.x, this.y);
  }
}

class MyEffects {
  #imageCell = [];
  #pixels = [];
  #ctx;
  #width;
  #height;

  constructor(ctx, width, height) {
    this.#ctx = ctx;
    this.#width = width;
    this.#height = height;
    this.#ctx.drawImage(imageOne, 0, 0, this.#width, this.#height);
    this.#pixels = this.#ctx.getImageData(0, 0, this.#width, this.#height);
  }

  #convertToSymbol(g) {
    if (g > 250) return symbolArray[0];
    else if (g > 240) return symbolArray[1];
    else if (g > 220) return symbolArray[2];
    else if (g > 200) return symbolArray[3];
    else if (g > 180) return symbolArray[4];
    else if (g > 160) return symbolArray[5];
    else if (g > 140) return symbolArray[6];
    else if (g > 120) return symbolArray[7];
    else if (g > 100) return symbolArray[8];
    else if (g > 80) return symbolArray[9];
    else if (g > 60) return symbolArray[10];
    else if (g > 40) return symbolArray[11];
    else if (g > 20) return symbolArray[12];
    else return "";
  }

  #scanImage(cellSize) {
    this.#imageCell = [];
    for (let y = 0; y < this.#pixels.height; y += cellSize) {
      for (let x = 0; x < this.#pixels.width; x += cellSize) {
        const posX = x * 4;
        const posY = y * 4;
        const myNum = posY * this.#pixels.width;
        const pos = myNum + posX;

        if (this.#pixels.data[pos + 3] > 128) {
          const red = this.#pixels.data[pos];
          const green = this.#pixels.data[pos + 1];
          const blue = this.#pixels.data[pos + 2];

          const total = red + green + blue;
          const averageColorValue = total / 3;
          const color = "rgb(" + red + ", " + green + "," + blue + ")";
          const symbol = this.#convertToSymbol(averageColorValue);
          if (total > 200) this.#imageCell.push(new Cell(x, y, symbol, color));
        }
      }
    }
  }

  #drawAscii() {
    this.#ctx.clearRect(0, 0, this.#width, this.height);
    for (let i = 0; i < this.#imageCell.length; i++) {
      this.#imageCell[i].draw(this.#ctx);
    }
  }

  draw(cellSize) {
    this.#scanImage(cellSize);
    this.#drawAscii();
  }
}

let effect;

function handelSlider() {
  if (inputSlider.value == 1) {
    inputLable.innerHTML = "Original Image";
    ctx.drawImage(imageOne, 0, 0, canvas.width, canvas.height);
  } else {
    inputLable.innerHTML = "Resolution :" + inputSlider.value + "px";
    ctx.font = parseInt(inputSlider.value) + 1.2 + "px Verdana";
    effect.draw(parseInt(inputSlider.value));
  }
}

imageOne.onload = function initialize() {
  canvas.width = imageOne.width;
  canvas.height = imageOne.height;
  effect = new MyEffects(ctx, imageOne.width, imageOne.height);
  handelSlider();
};
